local Counter = {}
local total = 0
local loaded = 0


local CollectionService = game:GetService("CollectionService") -- Oben im Script hinzufügen

local function restoreInstance(data, parent)
	local instance

	-- 1. Instanz erstellen (Spezialfälle)
	if data.ClassName == "MeshPart" then
		instance = Instance.new("MeshPart")
		Counter[instance] = true
		total = total + 1
		task.spawn(function()
			-- MeshId sicherstellen
			local meshId = data.Properties and data.Properties.MeshId
			if meshId then
				pcall(function()
					instance:ApplyMesh(game.InsertService:CreateMeshPartAsync(
						meshId,
						Enum.CollisionFidelity.Default,
						Enum.RenderFidelity.Precise
						))
				end)
				instance["TextureID"] = data.Properties.TextureID
			end
			Counter[instance] = nil
			loaded = loaded + 1

		end)
	elseif data.ClassName == "SurfaceAppearance" then
		local found = game.MaterialService:FindFirstChild(data.Properties.Name)
		if found then
			instance = found:Clone()
		end
	end

	if not instance then
		instance = Instance.new(data.ClassName)
	end

	-- 2. TAGS RESTOREN (NEU)
	if data.Tags and type(data.Tags) == "table" then
		for _, tag in pairs(data.Tags) do
			CollectionService:AddTag(instance, tag)
		end
	end

	-- 3. ATTRIBUTES RESTOREN (NEU)
	if data.Attributes and type(data.Attributes) == "table" then
		for attrName, attrValue in pairs(data.Attributes) do
			instance:SetAttribute(attrName, attrValue)
		end
	end

	-- 4. Parent Handling
	if instance.Parent == workspace then
		task.spawn(function()
			repeat task.wait(.1) until total == loaded 
			instance.Parent = parent
		end)
	else
		instance.Parent = parent
	end

	-- 5. Properties setzen
	if data.Properties then
		for propName, propValue in pairs(data.Properties) do
			pcall(function()
				instance[propName] = propValue
			end)
		end
	end

	-- 6. Kinder rekursiv wiederherstellen
	if data.Descendants then
		for _, childData in pairs(data.Descendants) do
			restoreInstance(childData, instance)
		end
	end

	return instance
end

local function RestoreJoints(model)
	local partMap = {}
	local partsToRestore = {}

	-- 1. Parts indizieren
	for _, p in ipairs(model:GetDescendants()) do
		if p:IsA("BasePart") then
			local uid = p:FindFirstChild("UnificationID")
			if uid then partMap[uid.Value] = p end
			table.insert(partsToRestore, p)
		end
	end

	-- 2. Joints wiederaufbauen
	for _, folder in ipairs(model:GetDescendants()) do
		local typeVal = folder:FindFirstChild("Type")
		if folder:IsA("Folder") and typeVal then
			local className = typeVal.Value
			local originalName = folder.Name:gsub("_Storage", "")

			-- --- FALL A: ADORNEE WIEDERHERSTELLUNG (An existierendem Objekt) ---
			-- Wenn der Folder eine Adornee-ID hat, suchen wir das Objekt (Highlight etc.), 
			-- das im Store-Schritt NICHT gelöscht wurde.
			local adorneeUID = folder:FindFirstChild("AdorneeTargetUID")
			if adorneeUID then
				local existingObj = folder.Parent:FindFirstChild(originalName)
				if existingObj then
					local targetPart = partMap[adorneeUID.Value]
					if targetPart then
						existingObj.Adornee = targetPart
					end
				end
			end

			-- --- FALL B: JOINT WIEDERAUFBAU (Deine exakte Original-Logik) ---
			-- Wir erstellen die Instance nur dann neu, wenn Part-Daten vorhanden sind
			-- (denn Joints wurden im Store-Schritt gelöscht).
			if folder:FindFirstChild("Part0") or folder:FindFirstChild("Part1") then
				local joint = Instance.new(className)
				joint.Name = originalName

				local p0 = folder:FindFirstChild("Part0") and partMap[folder.Part0.Value]
				local p1 = folder:FindFirstChild("Part1") and partMap[folder.Part1.Value]

				if p0 and p1 then
					if className == "WeldConstraint" then
						joint.Enabled = false
						local offset = folder:FindFirstChild("RelativeOffset")
						if offset then
							p1.CFrame = p0.CFrame * offset.Value
						end
					end

					joint.Part0 = p0
					joint.Part1 = p1

					if not joint:IsA("WeldConstraint") then
						if folder:FindFirstChild("C0") then joint.C0 = folder.C0.Value end
						if folder:FindFirstChild("C1") then joint.C1 = folder.C1.Value end
					end

					joint.Parent = folder.Parent

					if joint:IsA("WeldConstraint") then
						task.defer(function() joint.Enabled = true end)
					end
				end
			end

			folder:Destroy()
		end
	end

	-- 3. Zum Schluss: Anchored-Status wiederherstellen
	task.defer(function()
		for _, part in ipairs(partsToRestore) do
			local original = part:GetAttribute("OriginalAnchored")
			if original ~= nil then
				part.Anchored = original
			end
		end
	end)
end

local function restoreFolder(savedData, parent)
	for _, data in pairs(savedData) do
		local Folder = restoreInstance(data, parent)
		RestoreJoints(Folder)
		Folder.Parent = game[Folder.Name]
	end
end

local function parseTableImproved(str)
	str = str:gsub("%z", ""):match("^%s*(.-)%s*$")
	local i = 1
	local len = #str

	local constructors = {
		["Vector3"] = function(args) return Vector3.new(unpack(args)) end,
		["Vector2"] = function(args) return Vector2.new(unpack(args)) end,
		["CFrame"] = function(args) return CFrame.new(unpack(args)) end,
		["Color3"] = function(args) return Color3.new(unpack(args)) end,
		["UDim2"] = function(args) return UDim2.new(unpack(args)) end,
		["UDim"] = function(args) return UDim.new(unpack(args)) end,
		["Rect"] = function(args) return Rect.new(unpack(args)) end,
		["NumberSequence"] = function(args) 
			-- Falls args[1] bereits eine Tabelle ist (durch das { } in der Serialisierung)
			return NumberSequence.new(typeof(args[1]) == "table" and args[1] or args) 
		end,
		["ColorSequence"] = function(args) 
			return ColorSequence.new(typeof(args[1]) == "table" and args[1] or args) 
		end,
		["NumberRange"] = function(args)
			return NumberRange.new(unpack(args))
		end,
		["NumberSequenceKeypoint"] = function(args) return NumberSequenceKeypoint.new(unpack(args)) end,
		["ColorSequenceKeypoint"] = function(args) return ColorSequenceKeypoint.new(unpack(args)) end,

		["Font"] = function(args)
			return Font.new(
				args[1] or "rbxasset://fonts/families/SourceSansPro.json", 
				args[2] or Enum.FontWeight.Regular, 
				args[3] or Enum.FontStyle.Normal
			)
		end
	}
	local function skipWhitespace()
		while i <= len and str:sub(i, i):match("[%s,]") do
			i = i + 1
		end
	end

	local function parseValue()
		skipWhitespace()
		local char = str:sub(i, i)

		-- 1. TABELLEN (Hier liegt oft der Weld-Fehler)
		if char == "{" then
			i = i + 1
			local t = {}
			while i <= len do
				skipWhitespace()
				if str:sub(i, i) == "}" then i = i + 1 break end

				local key = nil
				-- Prüfe auf Schlüssel: [1]=, ["Key"]= oder Key=
				if str:sub(i, i) == "[" then
					i = i + 1
					key = parseValue()
					i = str:find("]", i) + 1
					skipWhitespace()
					if str:sub(i, i) == "=" then i = i + 1 end
				elseif str:find("^[%a_][%w_]*%s*=", i) then
					local startK, endK = str:find("^[%a_][%w_]*", i)
					key = str:sub(startK, endK)
					i = endK + 1
					skipWhitespace()
					if str:sub(i, i) == "=" then i = i + 1 end
				end

				local val = parseValue()
				if key ~= nil then 
					t[key] = val 
				else 
					table.insert(t, val) 
				end

				skipWhitespace()
				if str:sub(i, i) == "," then i = i + 1 end
			end
			return t

			-- 2. STRINGS
		elseif char == "\"" then
			local endStr = str:find("\"", i + 1)
			if not endStr then return "" end
			local s = str:sub(i + 1, endStr - 1)
			i = endStr + 1
			return s

			-- 3. BOOLEANS / NIL
		elseif str:find("^true", i) then i = i + 4 return true
		elseif str:find("^false", i) then i = i + 5 return false
		elseif str:find("^nil", i) then i = i + 3 return nil

			-- 4. ZAHLEN (Wichtig für Weld-Offsets)
		elseif char:match("[%d%-%.]") then
			local nStr = str:match("^[%d%.%-eE]+", i) -- Erkennt auch wissenschaftliche Notation
			i = i + #nStr
			return tonumber(nStr)

			-- 5. ROBLOX TYPEN (CFrame etc.)
			-- 5. ROBLOX TYPEN (CFrame, Sequenzen, etc.)
		elseif char:match("%a") then
			local identifier = str:match("^[%a%d%.%_]+", i)
			i = i + #identifier

			if identifier:match("^Enum%.") then
				local eType, eValue = identifier:match("Enum%.([^%.]+)%.(.+)")
				return Enum[eType][eValue]
			end

			local typeName = identifier:match("^([^%.]+)")
			if constructors[typeName] then
				skipWhitespace()
				if str:sub(i, i) == "(" then
					i = i + 1 -- Überspringe "("
					local args = {}

					-- REKURSIVES ARGUMENT-PARSING
					while i <= len do
						skipWhitespace()
						if str:sub(i, i) == ")" then 
							i = i + 1 
							break 
						end

						-- Hier liegt der Zauber: parseValue() erkennt, 
						-- ob im Argument wieder ein Keypoint oder eine Tabelle steckt!
						table.insert(args, parseValue())

						skipWhitespace()
						if str:sub(i, i) == "," then i = i + 1 end
					end

					return constructors[typeName](args)
				end
			end

			return identifier
		end
	end

	return parseValue()
end

