local EncodingService = game:GetService("EncodingService")

local function Decompress(b64String)
	local b64Buffer = buffer.fromstring(b64String)

	-- 1. Base64 Decode (Macht aus Text wieder einen binären Buffer)
	local compressedBuffer = EncodingService:Base64Decode(b64Buffer)

	-- 2. Zstd Decompress (Entpackt die Daten)
	local success, decompressedBuffer = pcall(function()
		return EncodingService:DecompressBuffer(compressedBuffer, Enum.CompressionAlgorithm.Zstd)
	end)

	if not success then
		warn("Dekomprimierung fehlgeschlagen!")
		return ""
	end

	-- HIER WAR DER FEHLER: Du musst den entpackten Buffer zurückgeben!
	-- .gsub("%z", "") entfernt mögliche Null-Bytes am Ende
	return buffer.tostring(decompressedBuffer):gsub("%z", "")
end

